# Define functions to determine filename and filepath
def getFilename(url):
    return os.path.basename(url)

def getFilepath(url):
    if "yellow_tripdata" in url:
        result = '/raw/tripdata_YellowTaxi.csv'
    elif "green_tripdata" in url:
        result = '/raw/tripdata_GreenTaxi.csv'
    elif "fhv_tripdata" in url:
        result = '/raw/tripdata_ForHireVehicle.csv'
    elif "fhvhv_tripdata" in url:
        result = '/raw/tripdata_HighVolumeForHireVehicle.csv'
    elif "/assets/tlc/downloads/pdf/trip_record" in url:
        result = '/raw/manual_TripRecord.pdf'
    elif "/assets/tlc/downloads/pdf/data_dictionary_trip_records" in url:
        result = '/raw/manual_DataDictionaries.pdf'
    elif "/assets/tlc/images/content/pages/about/taxi_zone_map" in url:
        result = '/raw/taxizone_Maps.jpg'
    elif "/nyc-tlc/misc/taxi+_zone_lookup" in url:
        result = '/raw/taxizone_Lookup.csv'
    elif "/nyc-tlc/misc/taxi_zones" in url:
        result = '/raw/taxizone_Zones.zip'
    else:
        result = '/raw/misc'
    return(result)

